 gaz cu nivel de siguranta 3 are o absorbtie excelenta a socurilor, t??v si sgs, puternic si durabil si poate modifica inaltimea balansoarului de la 45 cm la 54,5 cm.\n\npermiun materiale\nscaunul de birou din piele moale pu cu cusaturi fine si respirabilitate incomparabila asigura o experienta confortabila de sezut. spuma la rece rezistenta la deformare ajuta, de asemenea, scaunul de birou sa-si pastreze forma chiar si in timpul utilizarii prelungite, distribuie eficient sarcina si reduce durerile de spate.\n\nscaun de calculator\n\nscaun de birou ergonomic\n\nscaun de birou ergonomic\n\ndesign ergonomic\nscaunul de birou basetbl se adapteaza perfect formei corpului tau, astfel incat nu mai trebuie sa iti faci griji cu privire la disconfortul cauzat de statul lung. spatarul aerodinamic al scaunului de birou se potriveste perfect cu forma curbata a coloanei vertebrale umane, protejeaza coloana vertebrala pe toata lungimea sa si asigura o postura confortabila si stabila.\n\nsolid si robust\nscaunul de birou basetbl este format dintr-o baza metalica robusta, care asigura stabilitate si flexibilitate excelente. suport scaun director pentru o sarcina maxima de 140 kg. cu cinci brate, baza perfect echilibrata permite utilizatorilor de scaune de calculator sa se relaxeze la un confort de 120??.\n\nroti de inalta calitate\nrotile scaunului de birou masoara 6 cm in diametru. cele cinci roti de rulare silentioase cu miez de nailon si un strat de poliuretan (pu) ruleaza lin si fara efort pe podele dure si moi (parchet, laminat sau covor). ofera mobilitate deplina scaunului de birou, iar stratul lor de cauciuc protejeaza podeaua de zgarieturi.\nDespre acest articol\nScaun de birou confortabil: noul scaun de birou ergonomic imbunatatit, cu aspect unic si captuseala puternica pentru confort maxim, va ofera o experienta confortabila la locul de munca sau la divertisment.\nScaun de birou pivotant: Scaunul de jucator poate fi rotit la 360??, iar inaltimea scaunului si inaltimea cotiera sunt reglabile. Functia de inclinare si blocare dezvoltata, precum si pernele gatului si lombare pot proteja eficient coloana vertebrala si gatul.\nScaun de birou satisfacator: spatarul curbat inalt este acoperit cu piele premium respirabila pentru a va proteja coloana vertebrala si gatul. Rotile silentioase va protejeaza podeaua si ofera un mediu de birou linistit. Este o alegere ideala pentru birouri, intalniri si case private.\n[Scaun pentru computer de siguranta] Scaunul pentru computer a trecut de T??V si SGS, iar baza de nailon de inalta performanta poate sustine pana la 150 kg. Scaunul pentru computer este, de asemenea, un cadou bun pentru copiii sau prietenii tai.\nUsor de asamblat: va oferim toate instrumentele si instructiunile detaliate \/ videoclipuri ale scaunului de gaming. Daca aveti intrebari suplimentare, va rugam sa contactati BASETBL.","image":"https:\/\/allbun.ro\/wp-content\/uploads\/2022\/04\/616mlXzrYkS._AC_SL1500_-e1651477826583-1-e1651478287315.jpg","sku":"223","offers":[{"@type":"Offer","price":"256.99","priceValidUntil":"2023-12-31","priceSpecification":{"price":"256.99","priceCurrency":"RON","valueAddedTaxIncluded":"false"},"priceCurrency":"RON","availability":"http:\/\/schema.org\/InStock","url":"https:\/\/allbun.ro\/ro\/produs\/scaun-de-birou-basetbl-scaun-de-gaming-scaun-de-curse-cu-scaun-mare-design-ergonomic-cotiera-rabatabila-functie-basculanta-reglare-pe-inaltime-150-kg\/","seller":{"@type":"Organization","name":"ALLBUN","url":"https:\/\/allbun.ro\/ro"}}],"gtin13":"2000000057668"}]}</script> <div class="pswp" tabindex="-1" role="dialog" aria-hidden="true"><div class="pswp__bg"></div><div class="pswp__scroll-wrap"><div class="pswp__container"><div class="pswp__item"></div><div class="pswp__item"></div><div class="pswp__item"></div></div><div class="pswp__ui pswp__ui--hidden"><div class="pswp__top-bar"><div class="pswp__counter"></div> <button class="pswp__button pswp__button--close" aria-label="&Icirc;nchide (Esc)" data-no-tran